import React, { Component } from 'react'

export class TodoList extends Component {
    constructor(props) {
        super(props)

        this.state = {
             todos: ["Eat", "Sleep", "Breathe"]
        }
    }


    render() {
        let todos = this.state.todos.map((e, ind) => (
            <li key={ind}>{e}</li>
        ))
        return (
            <div>
                {todos}
            </div>
        )
    }
}

export default TodoList
